import React from 'react';
import { NavLink } from 'react-router-dom';

const NavBar = () => {
    return (
        <div className='NavBar'>
            <NavLink to='/welcome-page'>
            <text>
                Return to title
            </text> 
            </NavLink>
        </div>
    );
}

export default NavBar;
